import Body_login2 from '../Body/Body_Product/Body_login2'
import FooterTop from '../Footer/FooterTop'
import Footer from '../Footer/Footer';

function Login() {
  
  return (
    <>
    <div>
    <Header/> 
      <Menu/> 
      
      <FooterTop/>
      <Footer/>
      </div>
    </>
  );
}

export default Login;
